import React, { useState, useEffect } from 'react';
import api from '../../api/endpoint';
import { FiFileText, FiHeart, FiAlertCircle, FiUser } from 'react-icons/fi';

const MonDossier = () => {
  const [dossier, setDossier] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    loadDossier();
  }, []);

  const loadDossier = async () => {
    try {
      setLoading(true);
      setError(null);
      const data = await api.getData('/dossier/patient');
      setDossier(data);
    } catch (err) {
      console.error('Erreur dossier:', err);
      setError(err.message || 'Impossible de charger votre dossier médical.');
      setDossier(null);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="min-h-screen flex items-center justify-center bg-gray-50">
        <div className="text-center">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-500 mx-auto mb-4"></div>
          <p>Chargement de votre dossier...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="p-6 max-w-4xl mx-auto">
      <div className="mb-8">
        <h1 className="text-3xl font-bold text-gray-900 mb-2">Mon Dossier Médical</h1>
        <p className="text-gray-600">Vos informations médicales sécurisées</p>
      </div>

      {error && (
        <div className="bg-red-50 border border-red-200 text-red-800 px-6 py-4 rounded-xl mb-6">
          <div className="flex items-center">
            <FiAlertCircle className="h-5 w-5 mr-2" />
            {error}
          </div>
        </div>
      )}

      {dossier ? (
        <div className="bg-white rounded-xl shadow-sm border border-gray-100 overflow-hidden">
          <div className="p-8">
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8 mb-8">
              <div className="text-center p-6 bg-blue-50 rounded-xl">
                <FiUser className="h-12 w-12 text-blue-600 mx-auto mb-4" />
                <h3 className="text-lg font-semibold text-gray-900 mb-2">Identité</h3>
                <p className="text-gray-600">{dossier.nom || 'Non renseigné'}</p>
                <p className="text-sm text-gray-500">{dossier.age || 'Âge'} ans</p>
              </div>
              
              <div className="text-center p-6 bg-green-50 rounded-xl">
                <FiHeart className="h-12 w-12 text-green-600 mx-auto mb-4" />
                <h3 className="text-lg font-semibold text-gray-900 mb-2">Groupe sanguin</h3>
                <p className="text-2xl font-bold text-gray-900">{dossier.groupeSanguin || 'N/A'}</p>
              </div>
              
              <div className="text-center p-6 bg-purple-50 rounded-xl">
                <FiFileText className="h-12 w-12 text-purple-600 mx-auto mb-4" />
                <h3 className="text-lg font-semibold text-gray-900 mb-2">Allergies</h3>
                <p className="text-gray-600">{dossier.allergies || 'Aucune connue'}</p>
              </div>
            </div>

            {dossier.antencedents && (
              <div className="mb-8">
                <h3 className="text-xl font-semibold text-gray-900 mb-4">Antécédents médicaux</h3>
                <div className="bg-gray-50 p-6 rounded-xl">
                  <p className="text-gray-700 whitespace-pre-wrap">{dossier.antencedents}</p>
                </div>
              </div>
            )}

            {dossier.notes && (
              <div>
                <h3 className="text-xl font-semibold text-gray-900 mb-4">Notes importantes</h3>
                <div className="bg-indigo-50 p-6 rounded-xl">
                  <p className="text-gray-800 italic">{dossier.notes}</p>
                </div>
              </div>
            )}
          </div>
        </div>
      ) : !error && (
        <div className="text-center py-20 bg-white rounded-xl shadow-sm border border-gray-100">
          <FiFileText className="h-16 w-16 text-gray-300 mx-auto mb-4" />
          <h3 className="text-xl font-semibold text-gray-900 mb-2">Dossier vide</h3>
          <p className="text-gray-500 mb-6">Votre dossier médical sera créé lors de votre première consultation</p>
        </div>
      )}
      
      <div className="mt-8 flex gap-4">
        <button 
          onClick={loadDossier}
          className="flex-1 bg-blue-600 text-white py-3 px-6 rounded-xl hover:bg-blue-700 transition font-medium"
        >
          Actualiser
        </button>
      </div>
    </div>
  );
};

export default MonDossier;
